import {Github} from "./github"
import {Instagram} from "./instagram"
import {LinkedIn} from './linkedin'

export const icons = {
	GithubIcon: Github,
	InstagramIcon: Instagram
}

export default (id, props) => {
	return icons[id] ? icons[id](props) : icons._default()
}
